function json_parse(s){var t=window.JSON,c="C",p;if(t&&t.parse)try{return t.parse(s)}catch(x){return null}t=s.replace(/"([^"\\]|\\["\\\/bfnrt]|\\u\d{4})*"/g,"S").replace(/(-?[1-9]*\d)(\.\d+)?([eE][+-]?\d+)?/g,"A").replace(/(true|false|null)/g,"A").replace(/\s/g,"");do{p=t;t=t.replace(/\[([SAC](,[SAC])*)?\]/g,c).replace(/{(S:[SAC](,S:[SAC])*)?}/g,c)}while(p!=t&&t!=c);return t==c?eval("("+s+")"):null}
